  return (
    <div className="App">
      {/* {parse(resumeData.content), {
        replace: domNode => {
          if (domNode) {
            return {domNode.children}
          }
        }
      }} */}
      {/* {parse(resumeData, (
            replace: domNode =>(
                // if (domNode.attribs) {
                    return (domNode);
                // }  
            ))
        )} */}
      {parse(resumeData.content, {
        replace: domNode => {
          // console.log(domNode.attribs);
          // console.log('children', domNode.children[0].children[0].data);
          console.log(domNode.children);
          if (domNode.attribs && domNode.attribs.id === "profile-info") {
            if (domNode.attribs && domNode.attribs.id === "name") {
              // const reactEle = React.createElement("h1", {}, domNode.children[0].data)
              // return reactEle;
              return (<div className="profile-info"></div>)
            }
          }

          if (domNode.attribs &&  domNode.attribs.id === "social-links") {
            if (domNode.attribs && domNode.attribs === "href") {
              // const reactEle = React.createElement("a", {}, domNode.children[0].data)
              // return reactEle;
              return (<a href={domNode.attribs}>{domNode.children[0].data}{"returnnnnnn"}</a>)
            }
          }
        },
      })}
    </div>
  );
}

export default App;
